import React, {useState} from 'react';

const InputProject = () => {
    const [description, setDescription] = useState("");
    return(
        <div>
            <h1>Project List</h1>
            <form>
                <input type="text" 
                value={description}
                onChange = {e => setDescription(e.target.value)}/>
                <button>Add</button>
            </form>
        </div>
    )
};

export default InputProject;
